--
-- Déclencheurs `measurements`
--
DROP TRIGGER IF EXISTS `trigger_measurements`;
DELIMITER //
CREATE TRIGGER `trigger_measurements` AFTER INSERT ON `measurements`
 FOR EACH ROW BEGIN
	DECLARE count INT;
	SELECT COUNT(*) INTO count FROM last_measurements WHERE device_id = NEW.device_id;
	IF count = 0 THEN
			device_id = NEW.device_id,
			value = NEW.value, 
			image = NEW.image, 
			datetime = NEW.datetime,
			created_date = NEW.created_date;
	ELSE
		UPDATE last_measurements SET 
			device_id = NEW.device_id,
			value = NEW.value, 
			image = NEW.image, 
			datetime = NEW.datetime,
			created_date = NEW.created_date
			WHERE device_id = NEW.device_id;
	END IF;
END
//
DELIMITER ;

