(1, 'Welcome to K2 Mill Tech Ltd', 'Welcome to K2 Mill Tech Ltd', 'Welcome to K2 Mill Tech Ltd', '<table style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td align="center" valign="top" width="300px"><img alt="" id="u1450_img" src="http://localhost:8000/mos/images/introduce.png" style="width: 237px; height: 108px; margin-bottom: 50px;" />\r\n			<div>\r\n			<p style="font-size: 43px;font-weight: bold;line-height: 43px;"><span style="color:#EC3237">M</span>anage</p>\r\n\r\n			<p style="font-size: 43px;font-weight: bold;line-height: 43px;"><span style="color:#EC3237">O</span>ptimize</p>\r\n\r\n			<p style="font-size: 43px;font-weight: bold;line-height: 43px;"><span style="color:#EC3237">S</span>ecure</p>\r\n			</div>\r\n			</td>\r\n			<td>\r\n			<p>The world&#39;s first retrofittable building management system with zero programming required.</p>\r\n\r\n			<p><span style="font-weight: bold;font-style: italic;font-size: 14px;">K2 Mill Tech&#39;s - MOS</span>&nbsp;web platform with advanced controlling, monitoring and alarming functions.</p>\r\n			&nbsp;\r\n\r\n			<p>Building managers are looking for a solution that can simultaneously meet the challenge of rising energy costs and reduce their carbon footprint, while delivering the shortest possible payback.</p>\r\n			&nbsp;\r\n\r\n			<p><span style="font-weight: bold;font-style: italic;font-size: 14px;">K2 Mill Tech&#39;s MOS</span>&nbsp;delivers the most advanced building management system which can reduce commercial building energy costs up to 50%</p>\r\n			&nbsp;\r\n\r\n			<p><span style="font-weight: bold;font-style: italic;font-size: 14px;">K2 Mill Tech</span>&nbsp;brought together some of the most advanced, easy to implement control / monitoring functions, and today, we are leading the way for new generation of energy efficiency with our MOS building management portal, The world&#39;s first retrofittable building management system with zero programming required</p>\r\n			&nbsp;\r\n\r\n			<p><span style="font-weight: bold;font-style: italic;font-size: 14px;">K2 Mill Tech&#39;s MOS</span>&nbsp;is an intelligent, web-based building management solution that uses wireless networking technology in conjunction with advanced control hardware and software.</p>\r\n			&nbsp;\r\n\r\n			<p><span style="font-weight: bold;font-style: italic;font-size: 14px;">K2 Mill Tech ltd</span>. is rabidly growing with operations in Asia, Europe and US and our proven solutions have been utilised in hundreds of new and retrofitted buildings around the globe.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '<table style="font-size: 13px; width: 921px;">\r\n	<tbody>\r\n		<tr>\r\n			<td align="center" valign="top" width="300px"><img alt="" id="u1450_img" src="http://localhost:8000/mos/images/introduce.png" style="width: 237px; height: 108px; margin-bottom: 50px;" />\r\n			<div>\r\n			<p style="font-size: 43px; font-weight: bold; line-height: 43px;"><span style="color: rgb(236, 50, 55);">M</span>anage</p>\r\n\r\n			<p style="font-size: 43px; font-weight: bold; line-height: 43px;"><span style="color: rgb(236, 50, 55);">O</span>ptimize</p>\r\n\r\n			<p style="font-size: 43px; font-weight: bold; line-height: 43px;"><span style="color: rgb(236, 50, 55);">S</span>ecure</p>\r\n			</div>\r\n			</td>\r\n			<td>\r\n			<p>The world&#39;s first retrofittable building management system with zero programming required.</p>\r\n\r\n			<p><span style="font-weight: bold; font-style: italic; font-size: 14px;">K2 Mill Tech&#39;s - MOS</span>&nbsp;web platform with advanced controlling, monitoring and alarming functions.</p>\r\n			&nbsp;\r\n\r\n			<p>Building managers are looking for a solution that can simultaneously meet the challenge of rising energy costs and reduce their carbon footprint, while delivering the shortest possible payback.</p>\r\n			&nbsp;\r\n\r\n			<p><span style="font-weight: bold; font-style: italic; font-size: 14px;">K2 Mill Tech&#39;s MOS</span>&nbsp;delivers the most advanced building management s